//import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>header</h1>
      </header>
      <main className="App-main">
        <h2>main</h2>
        <section> 
          <h4> ккакая-то section</h4>
        </section>
      </main>
      <footer className="App-footer">
        <p>footer</p>
      </footer>
    </div>
  );
}


export default App;
